import React from "react";
import "./Company.css";
import img1 from "./image 26.png";
import img2 from "./busyhub.png";
import img3 from "./image 27.png";

function Company() {
  return (
    <div>
      <div className="sec6-container">
        <div>
          <img src={img1} alt="" />
        </div>
        <div>
          <img src={img2} alt="" />
        </div>
        <div>
          <img src={img3} alt="" />
        </div>
        <div></div>
        <div></div>
      </div>
    </div>
  );
}

export default Company;
